    /**
     * @Route("", name="home.get", methods={"GET"})
     */
    public function getAction()
    {
        /**
         * Find the most popular two sequential dates, per country, to host a two day seminar, based on survey results.
         * Each partner provides a list of available dates.
         * Steps;
         *  1: Organise data into countries
         *  2: Calculate most popular dates, by country
         *  3: Sort dates by popularity
         *  4: Rollback through dates, from most to least popular, and find 2 consecutive dates
         *  5: Prepare Output
         */

        /* Retrieve data from API */
        $data = $this->makeGet();
        $countMap = ['countries' => []];
        $attendeesMap = [
            'attendees' => []
        ];
        $datesMap = [];
        $output = [];
        $output['countries'] = [];

        /* 1 - Build Partners by Country and supplemental data structures */
        $partners = [];
        foreach ($data->partners as $key => $value) {
            if (!array_key_exists($value->country, $countMap['countries'])) {
                $countMap['countries'][$value->country] = 1;
            } else {
                $countMap['countries'][$value->country]++;
            }

            $datesMap[$value->country][] = $value->availableDates;
            $attendeesMap[$value->country][] = $value->email;
            $partners[$value->country][] = $value;
            $value->availableDates = array_flip($value->availableDates);
        }

        /* 2 - Calculate most popular dates, by country, based on survey data */
        $popularDates = [];
        foreach ($datesMap as $country => $dates) {
            foreach ($dates as $key => $value) {

                /* Counts popular dates by country */
                if (!array_key_exists($country, $popularDates)) {
                    $popularDates[$country] = [];
                }

                foreach ($value as $i => $j) {
                    if (!array_key_exists($j, $popularDates[$country])) {
                        $popularDates[$country][$j] = 1;
                    } else {
                        $popularDates[$country][$j]++;
                    }
                }

                /* Sort dates by popularity */
                asort($popularDates[$country]);
            }
        }
        
        /* 3 - Rollback through dates, from most to least popular, and find 2 consecutive dates */
        $startDates = [];
        $countryEmailList = [];
        foreach ($partners as $country => $data) {

            /* Ensure both dates are consecutive dates */
            $size = count($popularDates[$country]) - 1;
            $dates = [];
            $i = $size;
            while ($i >= 1) {

                /* Define new start point */
                $newStartIndex = ($i)-1;

                /* Get the 2 most popular dates for each country (event is 2 consecutive days in duration) */
                $dates = array_keys(array_slice($popularDates[$country], $newStartIndex, 2, true));
                $startDates[$country]['startDate'] = $dates[0];
                $startDates[$country]['endDate'] = $dates[1];
                $dayOnePieces = explode('-', $dates[0]);
                $dayTwoPieces = explode('-', $dates[1]);

                /* Break out of while loop when we find two consecutive dates */
                if ((int)$dayTwoPieces[2] === (int)$dayOnePieces[2] + 1) {
                    break;
                }

                $i--;
            }

            /* 4 - Remove unable to attend */
            foreach ($data as $key => $value) {

                /* If partner can attend both most popular dates */
                if (array_key_exists($dates[0], $value->availableDates) || array_key_exists($dates[0], $value->availableDates)) {
                    /* Remove Partner from attendees list */
                    if (!array_key_exists($country, $countryEmailList)) {
                        $countryEmailList[$country] = [];
                    }
                    $countryEmailList[$country][] = $value->email;
                }
            }

            /* 5 - Prepare Output */
            $output['countries'][] = [
                'attendeeCount' => count($countryEmailList[$country]),
                'attendees' => $countryEmailList[$country],
                'name' => $country,
                'startDate' => $startDates[$country]['startDate'],
                'endDate' => $startDates[$country]['endDate']
            ];
        }

        /* Make API request with the output */
        $apiRequest = $this->makePost($output);
    }

